INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(201778, 'zhTW', '我們準備好了，快點帶路！', '我們準備好了，快點帶路！', 35435),
(753, 'zhTW', '什麼?你說你幹不掉這個東西?', '', 35435),
(195400, 'zhTW', '請讓我看看你合成的精華。', '請讓我看看你合成的精華。', 35435),
(79796, 'zhTW', '發現薩滿石：火焰之觸', '發現薩滿石：火焰之觸', 35435),
(165870, 'zhTW', '', '等你準備好了，我會告訴你拉斯塔哈的殞落。', 35435),
(79799, 'zhTW', '發現薩滿石：巨魔之韌', '發現薩滿石：巨魔之韌', 35435),
(79798, 'zhTW', '發現薩滿石：狂風之怒', '發現薩滿石：狂風之怒', 35435),
(79804, 'zhTW', '發現薩滿石：寒冰之觸', '發現薩滿石：寒冰之觸', 35435),
(194274, 'zhTW', 'I want to teleport to Operation: Mechagon (Dungeon).', 'I want to teleport to Operation: Mechagon (Dungeon).', 35435),
(183984, 'zhTW', '|cfff2e699+$1i 點理智|r', '|cfff2e699+$1i 點理智|r', 35435),
(201777, 'zhTW', '', '我知道一條通往海洋之女那邊的捷徑，準備好的話就跟我來。', 35435),
(79794, 'zhTW', '發現薩滿石：野狼祝福', '發現薩滿石：野狼祝福', 35435),
(79795, 'zhTW', '發現薩滿石：野狼之魂', '發現薩滿石：野狼之魂', 35435),
(141708, 'zhTW', '削弱獅鷲獸的力量，你要記得|TInterface\\ICONS\\INV_MISC_DESECRATED_LEATHERGLOVE.BLP:20|t |cFFFF0000|Hspell:269442|h[抓緊]|h|r。', '', 35435),
(201784, 'zhTW', '我親眼看見的！珍娜女士在海上遭受攻擊！', '', 35435),
(165241, 'zhTW', '越來越深，越來越深…', '越來越深，越來越深…', 35435),
(165243, 'zhTW', '然後…擁抱陰影的真諦。', '然後…擁抱陰影的真諦。', 35435),
(165245, 'zhTW', '隨著你做出的每個選擇，你就越來越像我的僕役。', '隨著你做出的每個選擇，你就越來越像我的僕役。', 35435),
(165239, 'zhTW', '駕馭你的憤怒…將你的憎恨化為武器。', '駕馭你的憤怒…將你的憎恨化為武器。', 35435),
(165246, 'zhTW', '這些劣貨會在神的凝視下腐朽。', '這些劣貨會在神的凝視下腐朽。', 35435),
(165244, 'zhTW', '是的…你越來越靠近…已近在咫尺了。', '是的…你越來越靠近…已近在咫尺了。', 35435),
(165237, 'zhTW', '啊…你以為自己明白何謂力量。', '啊…你以為自己明白何謂力量。', 35435);
